import React from "react";
import styles from "../../index.module.scss";

function UsersList({ users }) {
  return (
    <>
      {users.map((user, key) => {
        return (
          <div className={styles.cardWrapper} key={key}>
            <div
              className={`${styles.userCard} ${
                user.voted ? styles.votedUser : ""
              }`}
            ></div>
            <div>{user.name}</div>
          </div>
        );
      })}
    </>
  );
}

export default UsersList;
